import React, {useEffect, useState} from 'react'

function App() {

  const[movies, setMovies] = useState([{}])

  useEffect(()=>{
    fetch("/api").then(
  response => response.json()
  ).then(
    data =>{
      setMovies(data)
    }
  )}, [])

  return (
    <div>

      {(typeof movies.users === 'undefined')? (
        <p>Loading...</p>
      ): (
       movies.users.map((user, i)=>(
          <p key={i}>{user}</p>
        ))
      )}
    </div>
  )
}

export default App
